import React from 'react';
import { Card, CardActions, CardContent, CardMedia, Button, Typography } from '@material-ui/core';
import DeleteIcon from '@material-ui/icons/Delete';
import MoreHorizIcon from '@material-ui/icons/MoreHoriz';

import useStyles from './styles'

const Post = ( { school }) => {
  const classes = useStyles();
  return (
    <Card className={classes}>
      <CardMedia style={{ height: 100, color: "black"}} className={classes.media} image={school.image} title="nklafjsdalf;sdajf" />
      <div className={classes.overlay}>
        <Typography variant="h6">{school.location}</Typography>
        <Typography variant="body2">{school.about}</Typography>
      </div>
      <div className={classes.overlay2}>
        <Button size="small" onClick={() => {}}>
          <MoreHorizIcon fontSize="default" />
        </Button>
        <div className={classes.details}>
          <Typography variant="body2" color="textSecondary">{school.admission}</Typography>
        </div>
      </div>

    </Card>
  );
}

export default Post;
